  const toggleMode = () => {
    setChangeMode(!changeMode);
  };

  return (
    <div className={changeMode ? "dark" : "light"}>
      <Header changeMode={changeMode} setChangeMode={setChangeMode} />
      <RoutesConfig /> {/* Utiliza tu configuración de rutas aquí */}
